import React from "react";
import "./Page1.css";

const SplitWindow = () => {
  return (
    <div className="container">
      <div className="left-pane">
        <img src="/images/recycle-bin.png" alt="Left" />
      </div>
      <div className="right-pane">
        <img src="/images/logo.png" alt="Right" />
      </div>
    </div>
  );
};

export default SplitWindow;
